window.bookSummaryJSON = "<p><b>Otto is Richard Krugg's only son and heir to the Shaman's gift. </b></p> <p>Otto doesn't want it. He wants to be a fisherman. When company policies force unwelcome changes onto his life and threaten even the security of the village, Otto discovers that being a shaman isn't optional. </p> <p>Jimmy Pirano is caught between the devil and the deep green sea when new production quotas are handed down from corporate headquarters. Locked into a century of existing practice, Jimmy is forced to find new ways to fish and new places to do it in or face the very real possibility that Pirano Fisheries will lose the St. Cloud franchise. </p> <p>Join Otto, Richard, and Rachel Krugg as they struggle with what it means to be the son of a shaman. Cast off with Jimmy, Tony, and Casey as they navigate the shoals and shallows of corporate fishery along the South Coast.</p>"; 
